from .models import db, Item, Pokemon
from datetime import date
from flask.cli import AppGroup

seed_commands = AppGroup('seed')

def seed_items():
    item1 = Item(
        name = 'Potion',
        happiness = 3,
        image_url = '../../../pokedex-refactor/backend/public/images/pokemon_potion.svg',
        price = 10,
        pokemon_id = 1
    )

    item2 = Item(
        name = 'berry',
        happiness = 5,
        image_url = '../../../pokedex-refactor/backend/public/images/pokemon_berry.svg',
        price = 100,
        pokemon_id = 2
    )

    item3 = Item(
        name = 'pokeball',
        happiness = 1,
        image_url = '../../../pokedex-refactor/backend/public/images/pokeball.svg',
        price = 14,
        pokemon_id = 3
    )

    return [item1, item2, item3]

def seed_pokemons():
    pokemon1 = Pokemon(
        number = 1,
        attack = 5,
        defense = 5,
        image_url = 'data:image/jpeg;base64,',
        name = 'Bulbasaur',
        type = 'grass',
        item_id = 1
    )
    pokemon2 = Pokemon(
        number = 2,
        attack = 10,
        defense = 10,
        image_url = 'data:image/jpeg;base64,',
        name = 'Ivysaur',
        type = 'grass',
        item_id = 2
    )
    pokemon3 = Pokemon(
        number = 3,
        attack = 15,
        defense = 15,
        image_url = 'data:image/jpeg;base64,',
        name = 'Venusaur',
        type = 'grass',
        item_id = 3
    )

    return [pokemon1, pokemon2, pokemon3]

@seed_commands.command('all')
def seed():
    items = seed_items()
    pokemons = seed_pokemons()
    
    for i in range (0, 3):
        db.session.add(pokemons[i])
        db.session.add(items[i])
    
    db.session.commit()